import React from 'react';
import {Field,reduxForm} from 'redux-form';
import testAction from '../actions/index';
import { connect } from "react-redux";

class LoginForm extends React.Component {


    componentWillMount(){
        this.props.testAction()
    }


    onSubmit(values){
        console.log(values); 
    }


    render(){
        const {handleSubmit} = this.props;
        console.log(this.props.testReducer);

        return(
          <form onSubmit={handleSubmit(this.onSubmit)}>
                     <h2> LoginForm </h2>
                <div>
                    <label>UserName</label>
                    <div>
                    <Field
                        name="UserName"
                        component="input"
                        type="UserName"
                        placeholder="UserName"
                    />
                    </div>
                </div>
                <div>
                    <label>PassWord</label>
                    <div>
                    <Field
                        name="PassWord"
                        component="input"
                        type="PassWord"
                        placeholder="PassWord"
                    />
                    </div>
                </div>
                <div>
                    <button type="submit" onClick = {this}>
                        SignUp
                    </button>
                    <button type="login">
                         Login
                    </button>
                </div>
          </form>
        );
    }
}
const mapStateToProps = (state) => {
    return state
}

const LoginTest = connect(mapStateToProps , {testAction})(LoginForm)

export default reduxForm({
    form :'LoginForm',
 }) (LoginTest);
